import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import "../../App.css"; // Adjusted path based on new folder structure

const EditErrorsPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { selectedDocument } = location.state || { selectedDocument: "Document 1" };

  const [errorIndex, setErrorIndex] = useState(0);
  const [correctedErrors, setCorrectedErrors] = useState(0);
  const totalErrors = 2105; // Placeholder total errors
  const [manualEdit, setManualEdit] = useState("");

  const errorList = [
    {
      sentence: (
        <span>
          There <span style={{ color: "red", fontWeight: "bold" }}>is</span> two museums
        </span>
      ),
      suggestions: ["are", "were", "was"],
      incorrectWord: "is",
    },
    // Future errors can be added here
  ];

  const handleNextError = () => {
    if (errorIndex < errorList.length - 1) {
      setErrorIndex((prev) => prev + 1);
      setCorrectedErrors((prev) => prev + 1);
      setManualEdit("");
    } else {
      navigate("/data-storage");
    }
  };

  const handleBack = () => {
    if (errorIndex > 0) {
      setErrorIndex((prev) => prev - 1);
      setCorrectedErrors((prev) => prev - 1);
    } else {
      navigate("/error-process", { state: { selectedDocument } });
    }
  };

  return (
    <div
      style={{
        backgroundColor: "#F0DFC3",
        fontFamily: "Proxima Nova",
        minHeight: "100vh",
        position: "relative",
        padding: "50px 100px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <h1
        style={{
          fontSize: "50px",
          fontWeight: "bold",
          color: "#A6785E",
          textAlign: "center",
          marginBottom: "50px",
        }}
      >
        Edit Document
      </h1>

      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          fontSize: "30px",
          color: "#50464E",
          marginBottom: "50px",
        }}
      >
        <p>Document: {selectedDocument}</p>
        <p>
          {correctedErrors}/{totalErrors} errors corrected
        </p>
      </div>

      <div style={{ fontSize: "30px", color: "#50464E", marginBottom: "30px" }}>
        <p>
          Full sentence: {errorList[errorIndex].sentence}
        </p>

        <p>Suggested words:</p>
        <div style={{ display: "flex", flexDirection: "column", gap: "15px" }}>
          {errorList[errorIndex].suggestions.map((word, idx) => (
            <label key={idx} style={{ cursor: "pointer" }}>
              <input type="radio" name="suggestion" style={{ marginRight: "10px" }} />
              {word}
            </label>
          ))}
          <label style={{ cursor: "pointer" }}>
            <input type="radio" name="suggestion" style={{ marginRight: "10px" }} />
            Manual edit:
            <input
              type="text"
              value={manualEdit}
              onChange={(e) => setManualEdit(e.target.value)}
              style={{
                marginLeft: "10px",
                padding: "5px 10px",
                borderRadius: "10px",
                border: "1px solid #A6785E",
              }}
            />
          </label>
        </div>
      </div>

      <div
        style={{
          display: "flex",
          justifyContent: "flex-end",
          gap: "25px",
          marginTop: "50px",
        }}
      >
        <button
          style={{
            fontSize: "30px",
            backgroundColor: "#DEA93D",
            color: "#50464E",
            padding: "10px 30px",
            borderRadius: "10px",
            border: "none",
            cursor: "pointer",
            fontWeight: "bold",
          }}
          onClick={handleBack}
        >
          Back
        </button>

        <button
          style={{
            fontSize: "30px",
            backgroundColor: "#DEA93D",
            color: "#50464E",
            padding: "10px 30px",
            borderRadius: "10px",
            border: "none",
            cursor: "pointer",
            fontWeight: "bold",
          }}
          onClick={handleNextError}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default EditErrorsPage;
